const Header = ({ onClick, people }) => {
  return (
    <div className="header">
      <div className="navbar">
        <p>Header</p>
        <p>People: {people}</p>
        <button
          onClick={() => onClick()}
          style={{ backgroundColor: "pink", padding: 10 }}
        >
          Change People
        </button>
      </div>
    </div>
  );
};

